CREATE TABLE WeightliftingSessions (
    session_id INT PRIMARY KEY,
    session_time TIMESTAMP,
    location VARCHAR(255),
    trainer_name VARCHAR(255)
);

CREATE TABLE trainers (trainer_id INT PRIMARY KEY,
  trainer_name VARCHAR(50),
  specialty VARCHAR(50));

CREATE TABLE weightlifting_sessions (
  session_id SERIAL PRIMARY KEY,
  session_time TIMESTAMP NOT NULL,
  location VARCHAR(255) NOT NULL,
  trainer_name VARCHAR(255) NOT NULL
);

CREATE TABLE locations (
  location_id SERIAL PRIMARY KEY,
  location_name VARCHAR(255) UNIQUE
);

CREATE TABLE trainers (
  trainer_id SERIAL PRIMARY KEY,
  trainer_name VARCHAR(255) UNIQUE
);

CREATE TABLE trainers (
    trainer_id INT PRIMARY KEY,
    trainer_name VARCHAR(50)
);

CREATE TABLE session_attendees (
    attendee_id INT PRIMARY KEY,
    session_id INT,
    attendee_name VARCHAR(50),
    FOREIGN KEY (session_id) REFERENCES weightlifting_sessions(session_id)
);

CREATE TABLE session_equipment (
    equipment_id INT PRIMARY KEY,
    session_id INT,
    equipment_name VARCHAR(50),
    FOREIGN KEY (session_id) REFERENCES weightlifting_sessions(session_id)
);

CREATE TABLE sessions ( 
	id INT PRIMARY KEY, 
	time TIMESTAMP, 
	location VARCHAR(255), 
	trainer VARCHAR(255) 
);

CREATE TABLE trainers ( 
	id INT PRIMARY KEY, 
	name VARCHAR(255) 
);

CREATE TABLE locations ( 
	id INT PRIMARY KEY, 
	name VARCHAR(255), 
	address VARCHAR(255) 
);

CREATE TABLE exercises ( 
	id INT PRIMARY KEY, 
	name VARCHAR(255), 
	description TEXT 
);

CREATE TABLE session_exercises ( 
	session_id INT, 
	exercise_id INT, 
	PRIMARY KEY (session_id, exercise_id) 
);
